i18n[syntax.osterExplain=Note: The preferable editor is the Netbeans editor. The Netbeans editor
 //- is less memory consuming,
 //- its highlightning is more exact,
 //- can handle many lines well.
 The Oster editor is still there because it can handle very long lines better than the Netbeans editor. This is due to a known bug in the Netbeans editor (Issue #41241). As soon as this bug is fixed the Oster editor will be removed.]
